import * as React from 'react';
import Box from '@mui/material/Box';
import { Toolbar, Typography } from '@mui/material';
export default function BoxSystemProps({ job }) {
  return (
    <Box
      height={200}
      width={300}
      my={4}
      display="grid"
      alignItems="center"
      gap={2}
      p={2}
      marginLeft={5}
      borderRadius={3}
      sx={{ border: '2px solid grey' }}
    >
    <Typography
    >
      {job.title}
    </Typography>
    {job.skills}
    </Box>
  );
}
